import React, { Component } from 'react'
import "./SmCardSection.css"

import SmCard from "./SmCard"

class SmCardSection extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="SmCardSection">
      <div>Open Design</div>
        <div className="SmCard-container">
          <SmCard />
          <SmCard />
          <SmCard />
          <SmCard />
        </div>
      </div>
    );
  }
}

export default SmCardSection;
